import '../Internal.css'


const ParagraphFive = () => {
    return (
        <p className='classic-about'>
            On a typical day filled with adventure, 
            my favorite pastime is <strong>photography & editing</strong>. 
            Take a look at some of my most recent shots, 
            capturing personal moments and memories.
        </p>
    )
}

export default ParagraphFive
